import React from "react";
import { NavLink } from "react-router-dom";

function Landing() {
  return (
    <>
      <Nav.Link to={"/"} as={NavLink}>
        Landing
      </Nav.Link>

      <Nav.Link to={"/FAQ"} as={NavLink}>
        FAQ
      </Nav.Link>
    </>
  );
}

export default Landing;
